import { Link } from 'react-router-dom';

const Navbar: React.FC = () => {
  return (
    <nav>
      <ul>
        <li><Link to="/">Home</Link></li>
        <li><Link to="/fileUpload">File Upload Page</Link></li>
              <li><Link to="/insights">Insights Display Page</Link></li>
              <li><Link></Link></li>
      </ul>
    </nav>
  );
};

export default Navbar;
